import React, { Component } from 'react';

import "./widget5.css"
import RondChart from './scatter & bubble charts/Scatter Chart';
import Titre5 from './Titre5/titre5';
import Comment5 from './Comment5/comment5';


class Widget5 extends Component{

    render(){

        const { titre5, comment5 } = this.props.data5 ; 
        return(
            <div className="cont5">
            <Titre5 titre5={titre5}/>
            <Comment5 comment5={comment5}/>
            <RondChart/>
          </div>
        );
    }

}

export default Widget5;
